class Solution:
    def maxProfit(self, prices: List[int]) -> int:
        def dfs(n):
            if n == len(prices):
                return 0
            profit = 0
            for i in range(n):
                profit += max(0, prices[i] - prices[n-i])
            return profit

        dp = [[0] * (len(prices))] * len(prices)
        for i in range(len(prices)):
            for j in range(len(prices)):
                if i == j:
                    dp[i][j] = 0
                else:
                    dp[i][j] = max(dp[i][j-1], dfs(j+1)) - prices[i]
        return max(dp[len(prices)-1])

